  name: ProcessRequest(HttpContext)
  nameWithType: TraceHandler.ProcessRequest(HttpContext)
  fullName: TraceHandler.ProcessRequest(HttpContext)
  type: Method
  assemblies:
  - System.Web
  namespace: System.Web.Handlers
  summary: Processes an HTTP request.
  remarks: "The <xref:System.Web.Handlers.TraceHandler.ProcessRequest%2A> method writes an <xref:System.Web.HttpResponse> that includes all current trace information. The trace information includes calls to the `protected`<xref:System.Web.Handlers.TraceHandler.ShowDetails%2A>, <xref:System.Web.Handlers.TraceHandler.ShowRequests%2A>, and <xref:System.Web.Handlers.TraceHandler.ShowVersionDetails%2A> methods.  \n  \n The <xref:System.Web.Handlers.TraceHandler> class implements the <xref:System.Web.Handlers.TraceHandler.ProcessRequest%2A> method to delegate to the implementation of the <xref:System.Web.Handlers.TraceHandler.ProcessRequest%2A> method. If you extend the <xref:System.Web.Handlers.TraceHandler> class, implement your own <xref:System.Web.Handlers.TraceHandler.ProcessRequest%2A> method to display different tracing information."
  syntax:
    content: protected void ProcessRequest (System.Web.HttpContext context);
    parameters:
    - id: context
      type: System.Web.HttpContext
      description: An <xref href="System.Web.HttpContext"></xref> object that provides access to the current `Request` and `Response` instances.
  overload: System.Web.Handlers.TraceHandler.ProcessRequest*
