- uid: System.Web.Handlers.TraceHandler.ShowDetails(System.Data.DataSet)
  commentId: M:System.Web.Handlers.TraceHandler.ShowDetails(System.Data.DataSet)
  id: ShowDetails(System.Data.DataSet)
  parent: System.Web.Handlers.TraceHandler
  langs:
  - csharp
  name: ShowDetails(DataSet)
  nameWithType: TraceHandler.ShowDetails(DataSet)
  fullName: TraceHandler.ShowDetails(DataSet)
  type: Method
  assemblies:
  - System.Web
  namespace: System.Web.Handlers
  summary: Writes the details of the current system state and page information to the response stream.
  remarks: The <xref:System.Web.Handlers.TraceHandler.ShowDetails%2A> method writes tracing details to the response stream, including information about the application state, session state for the current session, control tree created for the current page, and HTTP request information such as the query string and form parameters. It is called by <xref:System.Web.Handlers.TraceHandler.ProcessRequest%2A>, and cannot be overridden.
  syntax:
    content: protected void ShowDetails (System.Data.DataSet data);
    parameters:
    - id: data
      type: System.Data.DataSet
      description: A <xref href="System.Data.DataSet"></xref> object that contains tracing information.
  overload: System.Web.Handlers.TraceHandler.ShowDetails*
